import React from 'react';
import GoogleFonts from 'next-google-fonts';

export const Banner = () => {
    return(
        <React.Fragment>
            <div>I am Salie, a product designer who strives to make people enjoy the digital world.</div>
        </React.Fragment>
    )
}
